  return (
    <div className={styles.container}>
      {visibleModal ? (
        <>
          <Header
            visibleModal={visibleModal}
            setvVisibleModal={setVisibleModal}
          />
          <Table />
        </>
      ) : (
        false
      )}{' '}
      {/* <Header visibleModal={visibleModal} setvVisibleModal={setVisibleModal} />
      <Table /> */}
    </div>
  )
}

export default MainPage
